<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=0.8, maximum-scale=1.0, user-scalable=yes">
    <title>Be My Valentine</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=UnifrakturMaguntia&family=Cinzel:wght@400;600&display=swap');
        
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            background: linear-gradient(to bottom, #f4e4c1 0%, #e8d4a8 100%);
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            padding: 20px;
            font-family: 'Cinzel', serif;
            position: relative;
            overflow-x: hidden;
        }
        
        body::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background-image: 
                repeating-linear-gradient(0deg, transparent, transparent 2px, rgba(139, 101, 56, 0.03) 2px, rgba(139, 101, 56, 0.03) 4px),
                repeating-linear-gradient(90deg, transparent, transparent 2px, rgba(139, 101, 56, 0.03) 2px, rgba(139, 101, 56, 0.03) 4px);
            pointer-events: none;
            z-index: 0;
        }
        
        .container {
            max-width: 500px;
            width: 90%;
            position: relative;
            z-index: 1;
        }
        
        .card-container {
            background: #faf6ed;
            padding: 12px;
            border: 3px solid #8b6538;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.3),
                        inset 0 0 0 1px rgba(139, 101, 56, 0.2);
            margin-bottom: 30px;
            position: relative;
        }
        
        .card-container::before {
            content: '';
            position: absolute;
            top: -3px;
            left: -3px;
            right: -3px;
            bottom: -3px;
            border: 1px solid #d4af37;
            pointer-events: none;
        }
        
        .card-image {
            width: 100%;
            height: auto;
            display: block;
            border: 2px solid #8b6538;
        }
        
        .buttons-container {
            display: flex;
            gap: 15px;
            justify-content: center;
            align-items: center;
            margin-top: 20px;
            transition: all 0.3s ease;
        }
        
        button {
            font-family: 'Cinzel', serif;
            font-weight: 600;
            font-size: 16px;
            padding: 12px 30px;
            border: 3px solid;
            cursor: pointer;
            background: linear-gradient(to bottom, rgba(255, 255, 255, 0.3), rgba(255, 255, 255, 0.1));
            box-shadow: 0 4px 15px rgba(0, 0, 0, 0.3),
                        inset 0 1px 0 rgba(255, 255, 255, 0.5),
                        inset 0 -1px 0 rgba(0, 0, 0, 0.2);
            position: relative;
            transition: all 0.3s ease;
            text-transform: uppercase;
            letter-spacing: 2px;
        }
        
        button::before {
            content: '';
            position: absolute;
            top: -6px;
            left: -6px;
            right: -6px;
            bottom: -6px;
            border: 1px solid rgba(212, 175, 55, 0.5);
            pointer-events: none;
        }
        
        button:hover {
            transform: translateY(-2px);
            box-shadow: 0 6px 20px rgba(0, 0, 0, 0.4),
                        inset 0 1px 0 rgba(255, 255, 255, 0.6),
                        inset 0 -1px 0 rgba(0, 0, 0, 0.3);
        }
        
        button:active {
            transform: translateY(0);
        }
        
        #ayeBtn {
            background-color: #4169e1;
            border-color: #1e3a8a;
            color: #fff;
            text-shadow: 0 2px 4px rgba(0, 0, 0, 0.4);
        }
        
        #nayBtn {
            background-color: #dc143c;
            border-color: #8b0000;
            color: #fff;
            text-shadow: 0 2px 4px rgba(0, 0, 0, 0.4);
        }
        
        .message {
            display: none;
            text-align: center;
            font-family: 'UnifrakturMaguntia', cursive;
            font-size: 28px;
            color: #8b0000;
            padding: 25px;
            background: rgba(250, 246, 237, 0.9);
            border: 3px solid #8b6538;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.3);
            margin-top: 30px;
            line-height: 1.6;
            position: relative;
        }
        
        .message::before {
            content: '';
            position: absolute;
            top: -6px;
            left: -6px;
            right: -6px;
            bottom: -6px;
            border: 1px solid #d4af37;
            pointer-events: none;
        }
        
        .confetti {
            position: fixed;
            width: 10px;
            height: 10px;
            background: #f0f;
            animation: confetti-fall linear forwards;
            z-index: 1000;
            top: 0;
        }
        
        @keyframes confetti-fall {
            to {
                transform: translateY(100vh) rotate(360deg);
                opacity: 0;
            }
        }
        
        @media (max-width: 600px) {
            .container {
                max-width: 95%;
            }
            
            button {
                font-size: 14px;
                padding: 10px 20px;
            }
            
            .message {
                font-size: 24px;
                padding: 20px;
            }
        }
    </style>
</head>

        </div>
        
        <div class="buttons-container" id="buttonsContainer">
            <button id="ayeBtn">Aye</button>
            <button id="nayBtn">Nay</button>
        </div>
        
        <div class="message" id="message">
            Verily, I knew that thy heart didst bearst affection for me
        </div>
    </div>

    <script>
        const bgMusic = document.getElementById('bgMusic');
        const cheerSound = document.getElementById('cheerSound');
        
        // Start background music on first interaction
        let musicStarted = false;
        function startMusic() {
            if (!musicStarted) {
                bgMusic.play().catch(e => console.log('Music autoplay prevented'));
                musicStarted = true;
            }
        }
        
        let nayClickCount = 0;
        const nayTexts = [
            'Nay',
            'Art thou verily certaine',
            'Dost thou truly know',
            'Thy final opportunit hath arrived',
            'Say Aye'
        ];
        
        const ayeBtn = document.getElementById('ayeBtn');
        const nayBtn = document.getElementById('nayBtn');
        const message = document.getElementById('message');
        const buttonsContainer = document.getElementById('buttonsContainer');
        
        let ayeSize = 1;
        let naySize = 1;
        
        nayBtn.addEventListener('click', function() {
            startMusic();
            nayClickCount++;
            
            if (nayClickCount < nayTexts.length) {
                nayBtn.textContent = nayTexts[nayClickCount];
            } else {
                nayBtn.textContent = 'Say Aye';
            }
            
            naySize *= 0.85;
            ayeSize *= 1.15;
            
            nayBtn.style.transform = 'scale(' + naySize + ')';
            ayeBtn.style.transform = 'scale(' + ayeSize + ')';
        });
        
        ayeBtn.addEventListener('click', function() {
            startMusic();
            buttonsContainer.style.display = 'none';
            message.style.display = 'block';
            
            // Play cheer sound
            cheerSound.play().catch(e => console.log('Sound play prevented'));
            
            startConfetti();
        });
        
        function startConfetti() {
            setInterval(createConfetti, 100);
        }
        
        function createConfetti() {
            const confetti = document.createElement('div');
            confetti.className = 'confetti';
            
            const colors = ['#ff0000', '#00ff00', '#0000ff', '#ffff00', '#ff00ff', '#00ffff', '#ffa500', '#ff69b4'];
            confetti.style.background = colors[Math.floor(Math.random() * colors.length)];
            confetti.style.left = Math.random() * 100 + 'vw';
            confetti.style.animationDuration = (Math.random() * 3 + 2) + 's';
            confetti.style.opacity = Math.random();
            
            document.body.appendChild(confetti);
            
            setTimeout(function() {
                confetti.remove();
            }, 5000);
        }
    </script>
